import { target } from "nouislider";

export function changePriceSlider(numPriceMin: number, numPriceMax: number) {
  const rangePrice: target = document.querySelector(
    ".range-slider__range-price"
  ) as target;
  const minValuePrice = document.querySelector(
    ".value_min-price"
  ) as HTMLElement;
  const maxValuePrice = document.querySelector(
    ".value_max-price"
  ) as HTMLElement;

  const inputsValuePrice = [minValuePrice, maxValuePrice];

  rangePrice.noUiSlider?.set([numPriceMin, numPriceMax]);
  inputsValuePrice[0].innerHTML = String(numPriceMin) + "$";
  inputsValuePrice[1].innerHTML = String(numPriceMax) + "$";
}

export function changeStockSlider(numStockMin: number, numStockMax: number) {
  const rangeStock: target = document.querySelector(
    ".range-slider__range-stock"
  ) as target;
  const minValueStock = document.querySelector(
    ".value_min-stock"
  ) as HTMLElement;
  const maxValueStock = document.querySelector(
    ".value_max-stock"
  ) as HTMLElement;

  const inputsValueStock = [minValueStock, maxValueStock];

  rangeStock.noUiSlider?.set([numStockMin, numStockMax]);
  inputsValueStock[0].innerHTML = String(numStockMin);
  inputsValueStock[1].innerHTML = String(numStockMax);
}

let currentSlide = 0;

export function goToNextSlide(slidesArr: HTMLDivElement[]) {
  slidesArr[currentSlide].classList.add("hide-slide");
  currentSlide = (currentSlide + 1) % slidesArr.length;
  slidesArr[currentSlide].classList.remove("hide-slide");
}

export function infinitySlider() {
  const slider: HTMLDivElement = document.createElement("div");
  slider.classList.add("slider");
  const img1: HTMLDivElement = document.createElement("div");
  img1.classList.add("slider-img-1");

  const img2: HTMLDivElement = document.createElement("div");
  img2.classList.add("slider-img-2");

  const img3: HTMLDivElement = document.createElement("div");
  img3.classList.add("slider-img-3");

  slider.append(img1, img2, img3);

  const slidesArr: HTMLDivElement[] = [img3, img2, img1];

  setInterval(() => goToNextSlide(slidesArr), 10000);

  return slider;
}

import { products } from "../../data/data";

export function createInputCoutnInCart(id: number): HTMLDivElement {
  const inputCount: HTMLDivElement = document.createElement('div');
  inputCount.classList.add('input-count');
  const input: HTMLDivElement = document.createElement('div');
  input.textContent = `${products[id - 1].initialQuality}`;
  input.setAttribute('id', `input-id-${id}`);
  input.classList.add('input-count__number');
  const btnPlus: HTMLDivElement = document.createElement('div');
  btnPlus.setAttribute('data-idbtn', `${id}`);
  btnPlus.classList.add('input-count__btn-count');
  btnPlus.classList.add('btn-count_plus');
  const btnMinus: HTMLDivElement = document.createElement('div');
  btnMinus.setAttribute('data-idbtn', `${id}`);
  btnMinus.classList.add('input-count__btn-count');
  btnMinus.classList.add('btn-count_minus');
  inputCount.append(btnMinus, input, btnPlus);
  
  return inputCount;
}

export function createInputs(type: string, placeholder: string) : HTMLInputElement {
  const input: HTMLInputElement = document.createElement('input');
  input.setAttribute('type', `${type}`);
  input.setAttribute('placeholder', `${placeholder}`);
  input.classList.add('input');

  return input;
}

export function createSearchInput() : HTMLInputElement {
  const input = createInputs('text', 'Search');
  input.classList.add('input-search');
  input.classList.add('input-search_bg-img');
  
  return input;
}
